import React from "react";
import '../App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function Projects(){
  const proStyle = {
    backgroundcolor: 'skyblue',
    justifycontent: 'left'
  };
    return(
      <ul style={proStyle}>
        <h1>Computer Science</h1>
        <a href="https://github.com/" target="_blank"npm>My github</a>
        <h1>Artwork</h1>
        
      </ul>
    )
}



export default Projects;
